import { configureStore } from "@reduxjs/toolkit";
import {cartReducers, reducers} from './cartStore'
import { authReducers } from "./auth";

const Store =configureStore({
    reducer:{
        auth:authReducers,
        cart:cartReducers
    }
})
export default Store
